    // </div>

    <Router>
    <div className="App">
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/mylist" element={<MyList />} />
      </Routes>
    </div>
  </Router>
  );
}

export default App;
